INSERT INTO [dbo].[TmsActividadEconomica] ([Codigo] ,[Descripcion],[Nivel],[Estado],[FechaRegistro],[UsuarioRegistro]) VALUES('E3830.01','Actividades de procesamiento de desperdicios y desechos metálicos y no metálicos y de otros artículos para convertirlos en materias primas secundarias, normalmente mediante un proceso de transformación mecánico o químico; Recuperación de materiales de corrientes de desechos: Separación y clasificación de materiales recuperables de corrientes de desechos no peligrosos (basura); Separación y clasificación en categorías distintas de materiales recuperables mezclados como: papel, plásticos, latas de bebidas usadas, y metales. Entre los procesos de transformación mecánica o química que se realizan se cuentan los siguientes: Aplastamiento mecánico de desperdicios metálicos, como: automóviles usados, lavadoras usadas, bicicletas usadas, etcétera, para su posterior clasificación y separación; Desguace de automóviles, buques, computadoras, aparatos de televisión y otros equipos para la recuperación de materiales; Reducción mecánica de grandes volúmenes de metal, como vagones de ferrocarril; Trituración de desechos de metal, vehículos desechados, etcétera; Otros métodos de tratamiento mecánico, como el corte y el prensado para reducir el volumen.','6','Activo',GETDATE(),'admin@mail.com')
