INSERT INTO [dbo].[TmsActividadEconomica] ([Codigo] ,[Descripcion],[Nivel],[Estado],[FechaRegistro],[UsuarioRegistro]) VALUES('T9810.00','Actividades no diferenciadas de hogares como productores de bienes de subsistencia, es decir, las actividades de los hogares que producen diversos bienes para su propia subsistencia. Esas actividades comprenden la caza y la recolección, la agricultura, la construcción de viviendas y la confección de prendas de vestir y otros bienes producidos por los hogares para su propia subsistencia. Si los hogares se dedican a la producción de bienes para el mercado, se clasifican en la rama de producción correspondiente a esos bienes. Si se dedican principalmente a la producción de bienes de subsistencia específicos, se clasifican en la rama de producción correspondiente a esos bienes.','6','Activo',GETDATE(),'admin@mail.com')
